'''Antioch Township''' is a [[Civil township|township]] in [[White County, Arkansas]], United States.<ref name=2010-Census-PDF1 /> Its total population was 562 as of the [[2010 United States Census]],<ref name=2010-Census-Gazetteer /><ref name=2010-Census-AFF /> an increase of 15.4 percent from 487 at the [[2000 United States Census|2000 census]].<ref name=2000-Census-AFF /><ref name=2000-Census-Gazetteer />
According to the 2010 Census, Antioch Township is located at {{coord|35.141235|-91.940339|region:US-AR|format=dms|display=inline}} (35.141235, -91.940339).<ref name=2010-Census-Gazetteer /> It has a total area of {{convert|14.880|sqmi|sqkm|abbr=off|sp=us}}, all of which is land.<ref name=2010-Census-Gazetteer /> As per the [[United States Geological Survey|USGS]] [[National Elevation Dataset]], the elevation is {{convert|400|ft|m|0}}.<ref name=GNIS />
